ht:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Biografija</h2>		\n		<p style=\"text-align: left;\">\nNemanja Ristić  rođen je 10. maja 1992. godine u Kruševcu. Završio je master studije na Pravnom fakultetu u Novom Sadu 2017. godine.\nOd 2006. do 2016. bio je član KK \"Napredak\" iz Kruševca gde je sa velikim uspehom trenirao i dobitnik je brojnih priznanja i medalja (2<img role=\"img\" draggable=\"false\" src=\"https://s.w.org/images/core/emoji/14.0.0/svg/1f947.svg\" alt=\"🥇\" />, 3<img role=\"img\" draggable=\"false\" src=\"https://s.w.org/images/core/emoji/14.0.0/svg/1f948.svg\" alt=\"🥈\" />  i 3<img role=\"img\" draggable=\"false\" src=\"https://s.w.org/images/core/emoji/14.0.0/svg/1f949.svg\" alt=\"🥉\" />).\nTakođe, nosilac je i više diploma i priznanja na takmičenjima u okviru prakse i stažiranja na Pravnom fakultetu.U slobodno vreme se amaterski bavi muzičkom i video produkcijom (<style=\"color: #ffff00;\"><a style=\"color: #ffff00;\" href=\"https://soundcloud.com/razarlistovski\" target=\"_blank\" rel=\"noopener\">Razar Listovski</a>). Trenutno živi i radi u Novom Sadu.</p>		\n			<a href=\"https://youtu.be/3CC826YYljc?t=15\" target=\"_blank\" role=\"button\" rel=\"noopener\">\n						Poslušajte više\n					</a>\n			<h2>SoundCloud</h2>		\n				<iframe width=\"500\" height=\"400\" frameborder=\"no\" src=\"https://w.soundcloud.com/player/?visual=true&#038;url=https%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F369391091&#038;show_artwork=false&#038;maxheight=750&#038;maxwidth=500&#038;auto_play=false&#038;buying=true&#038;liking=true&#038;download=true&#038;sharing=true&#0