ps://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/1024x768-f2b21802-64bc-11eb-a115-0242ac130010-300x225.webp 300w, https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/1024x768-f2b21802-64bc-11eb-a115-0242ac130010-768x576.webp 768w, https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/1024x768-f2b21802-64bc-11eb-a115-0242ac130010.webp 1024w\" sizes=\"(max-width: 300px) 100vw, 300px\" />\n        <header><h2><a\n                        href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/mantije/\"\n                        title=\"Mantije\">Mantije</a></h2></header>\n                        <a\n                            href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/mantije/\"\n                           >Read More</a>\n    </article>','Recepti','','trash','closed','closed','','recepti__trashed','','','2022-08-05 11:24:02','2022-08-05 11:24:02','',0,'https://nristic.wppsbootcamp.com/trpkovic/?page_id=296',0,'page','',0),(297,1,'2022-08-04 17:34:26','2022-08-04 17:34:26','','Recepti','','inherit','closed','closed','','296-revision-v1','','','2022-08-04 17:34:26','2022-08-04 17:34:26','',296,'https://nristic.wppsbootcamp.com/trpkovic/?p=297',0,'revision','',0),(298,1,'2022-08-04 17:34:37','2022-08-04 17:34:37','<article data-id=\"318\">\n            <header><h2><a\n                        href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/uskoro-lokacija-na-novom-beogradu/\"\n                        title=\"Uskoro lokacija na Novom Beogradu!\">Uskoro lokacija na Novom Beogradu!</a></h2></header>\n                        <a\n                            href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/uskoro-lokacija-na-novom-beogradu/\"\n                           >Read More</a>\n    </article><article data-id=\"315\">\n            <header><h2><a\n                        href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/burek-sa-kolenicom/\"\n                        title=\"Burek sa kolenicom?\">Burek sa kolenicom?</a></h2></header>\n                        <a\n                            href=\"https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/burek-sa-kolenicom/\"\n                           >Read More</a>\n    </article>','Vesti','','trash','closed','closed','','vesti__trashed','','','2022-08-05 11:24:02','2022-08-05 11:24:02','',0,'https://nristic.wppsbootcamp.com/trpkovic/?page_id=298',0,'page','',0),(299,1,'2022-08-04 17:34:37','2022-08-04 17:34:37','','Vesti','','inherit','closed','closed','','298-revision-v1','','','2022-08-04 17:34:37','2022-08-04 17:34:37','',298,'https://nristic.wppsbootcamp.com/trpkovic/?p=299',0,'revision','',0),(302,1,'2022-08-04 17:37:39','2022-08-04 17:37:39','<!-- wp:paragraph -->\n<p>750 gr brašna prosejati, pa dodati so, promešati malo rukom, pa nalivati vodu i mesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Umesiti glatko testo. Potrebno je da se testo dobro izmesi.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podeliti na 5 jednakih delova, svaka loptica ima otprilike 250 gr.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Napraviti loptice pa pokriti kesom i krpom i ostaviti da odstoji 30 – 60 minuta. Nikako manje od 30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Za to vreme sitno iseckati luk, dodati mleveno meso, suvi začin i biber pa izmesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Otopiti puter sa uljem, na jakoj vatri. Kad provri skloniti sa vatre. Mora da provri da bi se maslo i ulje dobro sjedinili.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kad jufke odmore razvući svaku na prečnik otprilike 20 cm i svaku premazati sa 2 – 3 kašike otopljenog masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Slagati krugove jedan na drugi dok mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Stavite jedan premazeta pa drugi, tako do petog, peti ne mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pospite odgore brašnom, i stavite &nbsp;preko stola neko pletno, najbolje belo pamučno,&nbsp;pa i njega pospite sa malo brašna. Možete raditi i na stolu, ali vam onda treba više brašna, manje se lepi na tkaninu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste naslagali jedan krug na drugi i stavili na tkaninu ( dok stavljate već će početi da se razvlači). (slika)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Razvući oklagijom koliko možete a zatim i rukama do kraja stola.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste razvukli isecite deo koji visi sa stola, zadebljanje odstranite nožem ( krajeve ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na ivicu stavite celom dužinom 1/5 nadeva i malo isprskajte sa maslom i uljem ( slika ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uvijte jedan krug oko mesa pa isecite ( slika ), tako da sad imate tanku i dugačku rolnicu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tako uradite do kraja sa ostalim testom i mesom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim seckajte na dužinu 3 – 4 cm sve rolnice. Dobićete male jastučiće, meni tako bar izgledaju.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podmazati pleh prečnika 35 cm pa slagati u krug iseckane kvadratiće, jastučiće, kako hoćete pa premazati ih sa ostatkom masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dok motate rerna se greje na 250 stepeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada sve poslažete i premažete stavite da se peče dok ne porumeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na kraju kad je pečeno i kiselo mleko naseckajte belo luk i premažite preko vrelih mantija i ostavite 10 minuta poklopljeno drugom tepsijom da odstoji, pa poslužite posle 10 minuta.</p>\n<!-- /wp:paragraph -->','Mantije','','trash','open','open','','mantije__trashed','','','2022-08-05 11:23:36','2022-08-05 11:23:36','',0,'https://nristic.wppsbootcamp.com/trpkovic/?p=302',0,'post','',0),(303,1,'2022-08-04 17:37:33','2022-08-04 17:37:33','','1024x768-f2b21802-64bc-11eb-a115-0242ac130010','','inherit','open','closed','','1024x768-f2b21802-64bc-11eb-a115-0242ac130010','','','2022-08-04 17:37:33','2022-08-04 17:37:33','',302,'https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/1024x768-f2b21802-64bc-11eb-a115-0242ac130010.webp',0,'attachment','image/webp',0),(304,1,'2022-08-04 17:37:39','2022-08-04 17:37:39','<!-- wp:paragraph -->\n<p>750 gr brašna prosejati, pa dodati so, promešati malo rukom, pa nalivati vodu i mesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Umesiti glatko testo. Potrebno je da se testo dobro izmesi.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podeliti na 5 jednakih delova, svaka loptica ima otprilike 250 gr.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Napraviti loptice pa pokriti kesom i krpom i ostaviti da odstoji 30 – 60 minuta. Nikako manje od 30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Za to vreme sitno iseckati luk, dodati mleveno meso, suvi začin i biber pa izmesiti rukom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Otopiti puter sa uljem, na jakoj vatri. Kad provri skloniti sa vatre. Mora da provri da bi se maslo i ulje dobro sjedinili.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kad jufke odmore razvući svaku na prečnik otprilike 20 cm i svaku premazati sa 2 – 3 kašike otopljenog masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Slagati krugove jedan na drugi dok mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Stavite jedan premazeta pa drugi, tako do petog, peti ne mažete.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pospite odgore brašnom, i stavite &nbsp;preko stola neko pletno, najbolje belo pamučno,&nbsp;pa i njega pospite sa malo brašna. Možete raditi i na stolu, ali vam onda treba više brašna, manje se lepi na tkaninu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste naslagali jedan krug na drugi i stavili na tkaninu ( dok stavljate već će početi da se razvlači). (slika)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Razvući oklagijom koliko možete a zatim i rukama do kraja stola.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada ste razvukli isecite deo koji visi sa stola, zadebljanje odstranite nožem ( krajeve ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na ivicu stavite celom dužinom 1/5 nadeva i malo isprskajte sa maslom i uljem ( slika ).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uvijte jedan krug oko mesa pa isecite ( slika ), tako da sad imate tanku i dugačku rolnicu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tako uradite do kraja sa ostalim testom i mesom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim seckajte na dužinu 3 – 4 cm sve rolnice. Dobićete male jastučiće, meni tako bar izgledaju.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Podmazati pleh prečnika 35 cm pa slagati u krug iseckane kvadratiće, jastučiće, kako hoćete pa premazati ih sa ostatkom masla i ulja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dok motate rerna se greje na 250 stepeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kada sve poslažete i premažete stavite da se peče dok ne porumeni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na kraju kad je pečeno i kiselo mleko naseckajte belo luk i premažite preko vrelih mantija i ostavite 10 minuta poklopljeno drugom tepsijom da odstoji, pa poslužite posle 10 minuta.</p>\n<!-- /wp:paragraph -->','Mantije','','inherit','closed','closed','','302-revision-v1','','','2022-08-04 17:37:39','2022-08-04 17:37:39','',302,'https://nristic.wppsbootcamp.com/trpkovic/?p=304',0,'revision','',0),(305,1,'2022-08-04 17:39:32','2022-08-04 17:39:32','<!-- wp:paragraph -->\n<p>Sama priprema testa je jednostavna i brza, ako ne računam vreme koje je potrebno da testo odstoji pre pečenja. Mere su: koliko sira, toliko brašna i margarina, a soli po ukusu. Iako retko koristim margarin, to radim u ovom slučaju. Jedino što možete uraditi je da dodate kašiku masti margarinu. Zašto? Nekako mi se čini da ni margarin nije kao što je nekad bio i da testo sa margarinom bude tvrdo i suvo. Pretpostavljam da je to zbog smanjene količine masnoće. Kako god, pravili pogačice po receptu ili nešto eksperimentisali, mere su sledeće:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>250 g brašna,</li><li>250 g sitnog sira,</li><li>250 g margarina (ili masti),</li><li>1 kašikica soli (ako je sir neslan, ako je slan, dovoljno je i 1/2 kašikice).</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Napomena: ako pravite za veće društvo, duplirajte ili utrostručite meru jer ove pogačice nestaju brzinom svetlosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U odgovarajuću posudu za mešenje, rukama izmrvite margarin u brašnu. Margarin se mora što bolje izmešati sa brašnom, ali nemojte da ga topite, jer ćete ga onda jako teško ravnomerno umešati. U to dodajte sitni, nemasni tzv. “švapski” sir. Sve zajedno dobro izmesite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U čemu je “kvaka” sa ovim receptom?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Važno je da ovo testo mora da odstoji najmanje jedan sat u frižideru, odnosno da se ohladi i stegne. Najbolje rezultate daje ako ga napravite dan ranije. Ako ih pečete odmah pogačice neće narasti. Možete da napravite i veću količinu testa, koju možete držati u zamrzivaču, a odmrzavati kasnije po potrebi, premesiti i praviti pogačice. Poenta je da testo treba malo da fermentiše kako bi bolje naraslo prilikom pečenja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Druga važna stvar je da ne dodajete ništa više od onog što sam napisala. Ako vam se učini da je testo suviše mekano i da se lepi – nema veze, kad odstoji i kad se ohladi moći ćete ga bolje umestiti, odn. premesiti. Zato ovo testo i treba praviti u nekoj posudi, a ne na dasci za mešenje. Ako dodate brašna više nego što treba, dobićete kamenčiće umesto pogačica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dobro rashlađeno testo razvijte na debljinu između 0,5 i 1 cm. Vadite pogačice čašicom ili modlom prečnika otprilike 2-3 cm, ne treba da budu velike. Pogačice ređajte u tepsiju. Od gore ih možete premazati umućenim jajetom i posuti mlevenim biberom, kimom, susamom… čime volite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tepsiju sa pogačicama stavite u zagrejanu rernu na 220ºC. Pecite ih dvadesetak minuta, odnosno dok lepo ne porumene.</p>\n<!-- /wp:paragraph -->','Pogačice sa sirom','','trash','open','open','','pogacice-sa-sirom__trashed','','','2022-08-05 11:23:36','2022-08-05 11:23:36','',0,'https://nristic.wppsbootcamp.com/trpkovic/?p=305',0,'post','',0),(306,1,'2022-08-04 17:39:25','2022-08-04 17:39:25','','pogacice-sa-sirom2','','inherit','open','closed','','pogacice-sa-sirom2','','','2022-08-04 17:39:25','2022-08-04 17:39:25','',305,'https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pogacice-sa-sirom2.jpg',0,'attachment','image/jpeg',0),(307,1,'2022-08-04 17:39:32','2022-08-04 17:39:32','<!-- wp:paragraph -->\n<p>Sama priprema testa je jednostavna i brza, ako ne računam vreme koje je potrebno da testo odstoji pre pečenja. Mere su: koliko sira, toliko brašna i margarina, a soli po ukusu. Iako retko koristim margarin, to radim u ovom slučaju. Jedino što možete uraditi je da dodate kašiku masti margarinu. Zašto? Nekako mi se čini da ni margarin nije kao što je nekad bio i da testo sa margarinom bude tvrdo i suvo. Pretpostavljam da je to zbog smanjene količine masnoće. Kako god, pravili pogačice po receptu ili nešto eksperimentisali, mere su sledeće:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>250 g brašna,</li><li>250 g sitnog sira,</li><li>250 g margarina (ili masti),</li><li>1 kašikica soli (ako je sir neslan, ako je slan, dovoljno je i 1/2 kašikice).</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Napomena: ako pravite za veće društvo, duplirajte ili utrostručite meru jer ove pogačice nestaju brzinom svetlosti.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U odgovarajuću posudu za mešenje, rukama izmrvite margarin u brašnu. Margarin se mora što bolje izmešati sa brašnom, ali nemojte da ga topite, jer ćete ga onda jako teško ravnomerno umešati. U to dodajte sitni, nemasni tzv. “švapski” sir. Sve zajedno dobro izmesite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U čemu je “kvaka” sa ovim receptom?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Važno je da ovo testo mora da odstoji najmanje jedan sat u frižideru, odnosno da se ohladi i stegne. Najbolje rezultate daje ako ga napravite dan ranije. Ako ih pečete odmah pogačice neće narasti. Možete da napravite i veću količinu testa, koju možete držati u zamrzivaču, a odmrzavati kasnije po potrebi, premesiti i praviti pogačice. Poenta je da testo treba malo da fermentiše kako bi bolje naraslo prilikom pečenja.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Druga važna stvar je da ne dodajete ništa više od onog što sam napisala. Ako vam se učini da je testo suviše mekano i da se lepi – nema veze, kad odstoji i kad se ohladi moći ćete ga bolje umestiti, odn. premesiti. Zato ovo testo i treba praviti u nekoj posudi, a ne na dasci za mešenje. Ako dodate brašna više nego što treba, dobićete kamenčiće umesto pogačica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dobro rashlađeno testo razvijte na debljinu između 0,5 i 1 cm. Vadite pogačice čašicom ili modlom prečnika otprilike 2-3 cm, ne treba da budu velike. Pogačice ređajte u tepsiju. Od gore ih možete premazati umućenim jajetom i posuti mlevenim biberom, kimom, susamom… čime volite.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tepsiju sa pogačicama stavite u zagrejanu rernu na 220ºC. Pecite ih dvadesetak minuta, odnosno dok lepo ne porumene.</p>\n<!-- /wp:paragraph -->','Pogačice sa sirom','','inherit','closed','closed','','305-revision-v1','','','2022-08-04 17:39:32','2022-08-04 17:39:32','',305,'https://nristic.wppsbootcamp.com/trpkovic/?p=307',0,'revision','',0),(308,1,'2022-08-04 17:40:45','2022-08-04 17:40:45','<!-- wp:paragraph -->\n<p>Prvo oljuštiti crni luk i iseckati na sitnije kockice. Zatim u dublji tiganj staviti mleveno meso i sipati ulje, pa to dinstati na srednjoj temperaturu mešajući oko 3-4 minuta, da se meso fino izdinsta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim dodati crni luk, posoliti i pobiberiti i nastaviti dinstati mešajući oko 5-10 minuta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uključiti rernu da se greje na 200 stepeni. Nakon toga pripremiti preliv od ulja i kisele vode, blago umutiti viljuškom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sada uzeti jedan dublji i veći okrugli pleh i na dno sipati 2 kašike ulja, pa ravnomerno namazati dno i ivice pleha.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prvo odvojiti sa strane 2 kore koje treba staviti na samom kraju pravljenja bureka. Na dno pleha prvo staviti 2 prazne kore i ostaviti da krajevi kore budu van pleha. Sada staviti oko 2-3 pune kašike mlevenog mesa i ravnomerno rasporediti u plehu. Meso sada preliti sa 4-5 kašika preliva i onda posle toga krajeve kore koje se bile van pleha staviti u pleh i blago pritisnuti. Tako nastaviti ređati sada po jednu koru, pa onda na svaku koru staviti meso i preliti sa prelivom, a krajeve kore ubaciti u pleh posle svake druge kore i pritisnuti blago.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na samom kraju staviti 2 prazne kore gore, saviti krajeve kore i staviti u pleh. Preliti sa ostatkom preliva, oko 1 dl i probosti sa čačkalicom burek na više mesta. Staviti burek da se peče. Peći na 200 stepeni oko 40 minuta, odnosno sve dok lepo ne porumeni i gornja kora ne bude hrskava.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Burek sa mesom poslužiti toplo uz salatu od pradajza, uz kiselo mleko, jogurt, ili po želji.</p>\n<!-- /wp:paragraph -->','Burek sa mesom','','trash','open','open','','burek-sa-mesom__trashed','','','2022-08-05 11:23:36','2022-08-05 11:23:36','',0,'https://nristic.wppsbootcamp.com/trpkovic/?p=308',0,'post','',0),(309,1,'2022-08-04 17:40:31','2022-08-04 17:40:31','','burek','','inherit','open','closed','','burek','','','2022-08-04 17:40:31','2022-08-04 17:40:31','',308,'https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/burek.webp',0,'attachment','image/webp',0),(310,1,'2022-08-04 17:40:45','2022-08-04 17:40:45','<!-- wp:paragraph -->\n<p>Prvo oljuštiti crni luk i iseckati na sitnije kockice. Zatim u dublji tiganj staviti mleveno meso i sipati ulje, pa to dinstati na srednjoj temperaturu mešajući oko 3-4 minuta, da se meso fino izdinsta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Zatim dodati crni luk, posoliti i pobiberiti i nastaviti dinstati mešajući oko 5-10 minuta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Uključiti rernu da se greje na 200 stepeni. Nakon toga pripremiti preliv od ulja i kisele vode, blago umutiti viljuškom.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sada uzeti jedan dublji i veći okrugli pleh i na dno sipati 2 kašike ulja, pa ravnomerno namazati dno i ivice pleha.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prvo odvojiti sa strane 2 kore koje treba staviti na samom kraju pravljenja bureka. Na dno pleha prvo staviti 2 prazne kore i ostaviti da krajevi kore budu van pleha. Sada staviti oko 2-3 pune kašike mlevenog mesa i ravnomerno rasporediti u plehu. Meso sada preliti sa 4-5 kašika preliva i onda posle toga krajeve kore koje se bile van pleha staviti u pleh i blago pritisnuti. Tako nastaviti ređati sada po jednu koru, pa onda na svaku koru staviti meso i preliti sa prelivom, a krajeve kore ubaciti u pleh posle svake druge kore i pritisnuti blago.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na samom kraju staviti 2 prazne kore gore, saviti krajeve kore i staviti u pleh. Preliti sa ostatkom preliva, oko 1 dl i probosti sa čačkalicom burek na više mesta. Staviti burek da se peče. Peći na 200 stepeni oko 40 minuta, odnosno sve dok lepo ne porumeni i gornja kora ne bude hrskava.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Burek sa mesom poslužiti toplo uz salatu od pradajza, uz kiselo mleko, jogurt, ili po želji.</p>\n<!-- /wp:paragraph -->','Burek sa mesom','','inherit','closed','closed','','308-revision-v1','','','2022-08-04 17:40:45','2022-08-04 17:40:45','',308,'https://nristic.wppsbootcamp.com/trpkovic/?p=310',0,'revision','',0),(311,1,'2022-08-04 17:42:35','2022-08-04 17:42:35','{\n    \"astra-settings[single-post-content-layout]\": {\n        \"value\": \"plain-container\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:41:56\"\n    },\n    \"astra-settings[single-post-sidebar-layout]\": {\n        \"value\": \"no-sidebar\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:41:56\"\n    },\n    \"astra-settings[blog-single-meta]\": {\n        \"value\": [\n            \"category\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:41:56\"\n    },\n    \"astra-settings[enable-related-posts]\": {\n        \"value\": true,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:41:56\"\n    }\n}','','','trash','closed','closed','','45f5253d-e08f-440e-ad39-e78f6aee4308','','','2022-08-04 17:42:35','2022-08-04 17:42:35','',0,'https://nristic.wppsbootcamp.com/trpkovic/?p=311',0,'customize_changeset','',0),(312,1,'2022-08-04 17:42:52','2022-08-04 17:42:52','{\n    \"astra-settings[archive-post-content-layout]\": {\n        \"value\": \"plain-container\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:42:52\"\n    },\n    \"astra-settings[archive-post-sidebar-layout]\": {\n        \"value\": \"no-sidebar\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:42:52\"\n    },\n    \"astra-settings[blog-meta]\": {\n        \"value\": [\n            \"category\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-08-04 17:42:52\"\n    }\n}','','','trash','closed','closed','','497cd184-2b5c-496c-8135-177be4c0c318','','','2022-08-04 17:42:52','2022-08-04 17:42:52','',0,'https://nristic.wppsbootcamp.com/trpkovic/2022/08/04/497cd184-2b5c-496c-8135-177be4c0c318/',0,'customize_changeset','',0),(313,1,'2022-08-04 17:44:51','2022-08-04 17:44:51','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2022-08-04 17:44:51','2022-08-04 17:44:51','',1,'https://nristic.wppsbootcamp.com/trpkovic/?p=313',0,'revision','',0),(315,1,'2022-08-04 17:46:33','2022-08-04 17:46:33','<!-- wp:paragraph -->\n<p>Pre nekoliko dana, u jeku pandemije i ekonomskih potresa, pažnju je privukla jedna pekara iz Pančeva, čija je vlasnica pronašla način da održi poslovanje, na zadovoljstvo i kupaca i zaposlenih.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U trenu je osvanula vest o sada već čuvenom burekomatu, ali kada smo kontaktirali vlasnicu pekare “Burek Stankoski”, odmah nas je ispravila rekavši da nije reč o klasičnom automatu, već o šalteru. Ideja je, naravno, da se eliminiše gužva u objektu, i da se sama prodaja odvija bezbednije i brže.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Snalažljiv kolektiv je brzo osposobio šalter za rad, koji funkcioniše tako što se kroz gornji otvor daje novac, a kroz donji otvor – hrana. Prodavci nose rukavice i maske sve vreme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Inače, pekara “Burek Stankoski” je odavno poznata po dobrom bureku, ovde su svraćali mnogi poznati, a čak i sada u vreme krize – imaju mušterije iz okolnih mesta i gradova. Jedan Zemunac kaže da u Pančevo samo zbog bureka dolazi već peti put, a ima i Beograđana.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O tome da se ideja veoma dopada svima, najbolje svedoči red ispred pekare. Kupci su oduševljeni. Poštuju i pravilo o držanju distance u redu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U ponudi su šest slanih i dva slatka bureka, a najpopularniji je onaj s kolenicom. Vlasnica pekare, Svetlana Radaković, kaže za Telegraf Biznis da će šalter biti u funkciji sve dok traje pandemija, a onda će ga ukloniti, iako primećuje da se mnogima ovakav vid usluge dopada.</p>\n<!-- /wp:paragraph -->','Burek sa kolenicom?','','trash','open','open','','burek-sa-kolenicom__trashed','','','2022-08-05 11:23:36','2022-08-05 11:23:36','',0,'https://nristic.wppsbootcamp.com/trpkovic/?p=315',0,'post','',0),(316,1,'2022-08-04 17:46:28','2022-08-04 17:46:28','','stankoski','','inherit','open','closed','','stankoski','','','2022-08-04 17:46:28','2022-08-04 17:46:28','',315,'https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/stankoski.jpg',0,'attachment','image/jpeg',0),(317,1,'2022-08-04 17:46:33','2022-08-04 17:46:33','<!-- wp:paragraph -->\n<p>Pre nekoliko dana, u jeku pandemije i ekonomskih potresa, pažnju je privukla jedna pekara iz Pančeva, čija je vlasnica pronašla način da održi poslovanje, na zadovoljstvo i kupaca i zaposlenih.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>U trenu je osvanula vest o sada već čuvenom burekomatu, ali kada smo kontaktirali vlasnicu pekare “Burek Stankoski”,