vodi su proizvedeni od najkvalitetnijih sirovina na tradicionalan način, bez upotrebe aditiva.</p>		\n			<a href=\"https://nristic.wppsbootcamp.com/trpkovic/lokacije/\" role=\"button\">\n						Pogledaj lokacije\n					</a>\n															<img width=\"550\" height=\"309\" src=\"https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pocetna.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pocetna.jpg 550w, https://nristic.wppsbootcamp.com/trpkovic/wp-content/uploads/2022/08/pocetna-300x169.jpg 300w\" sizes=\"(max-width: 550px) 100vw, 550px\" />															\n		https://www.youtube.com/watch?v=8bBt9QqEBrc		\n			<h2>Garancija kvaliteta od 1905. godine</h2>		\n		<p>Tri prodajna objekta Pekare Trpković, nalaze se na tri lokacije u centru Beograda: Zvezdara, Dušanovac i Slavija.</p><p>Postoji i mogućnost dostave na kućnu adresu za veće potrošače.</p>		\n			<a href=\"https://nristic.wppsbootcamp.com/trpkovic/kontakt/\" role=\"button\">\n						Kontaktirajte nas\n					</a>','Početna','','inherit','closed','closed','','41-autosave-v1','','','2022-08-05 17:47:51','2022-08-05 17:47:51','',41,'https://nristic.wppsbootcamp.com/trpkovic/?p=435',0,'revision','',0),(437,1,'2022-08-12 16:30:28','2022-08-12 16:30:28','<!-- wp:paragraph -->\n<p>Our Products</p>\n<!-- /wp:paragraph -->','Products','','publish','closed','closed','','products','','','2022-08-12 16:30:28','2022-08-12 16:30:28','',0,'https://nristic.wppsbootcamp.com/trpkovic/?page_id=437',0,'page','',0),(438,1,'2022-08-12 16:30:28','2022-08-12 16:30:28','<!-- wp:paragraph -->\n<p>Our Products</p>\n<!-- /wp:paragraph -->','Products','','inherit','closed','closed','','437-revision-v1','','','2022-08-12 16:30:28','2022-08-12 16:30:28','',437,'https://nristic.wppsbootcamp.com/trpkovic/?p=438',0,'revision','',0);
